import { useSelector } from 'react-redux';

import { Items } from '../Reducers/cartReducer';
import { RootState } from '../Reducers';
import FoodsType from './FoodsType';

export default function FoodsCategories() {
  const { foodData } = useSelector((store: RootState) => store.foodDataReducer);
  const { sortedFoodsData } = useSelector((store: RootState) => store.foodDataReducer);

  console.log(sortedFoodsData);
  const $sortedFoodsArray = sortedFoodsData.map(([type, list]: FoodsTypeProps): JSX.Element=> {
    return <FoodsType type={type} list={list} />
  });

  return (
    <>
    {$sortedFoodsArray}
    </>
  )
}

export type FoodsTypeProps = [string, Items[]];
